import React from 'react';
import './App.css';

import Task from './Task';

const users = [
    {id: 1, name: 'Vuqar', surname: 'Mammadov'},
    {id: 2, name: 'Elnar', surname: 'Almazov'},
    {id: 3, name: 'Pervin', surname: 'Meryem'},
    ];

function App() {
  return (
      <Task todolist={users} />
  );
}

export default App;
